--  DDL for Trigger UPDATE_EMP_HISTORY
--------------------------------------------------------

  CREATE OR REPLACE EDITIONABLE TRIGGER "UPDATE_EMP_HISTORY" 
  AFTER UPDATE OF roleid, salary ON pt_employees
  FOR EACH ROW
DECLARE
  l_sdate date;
BEGIN
if (:old.roleid != :new.roleid
 or :old.salary != :new.salary
 ) 
then
  for c1 in 
    (select max(end_date) prev_start_date 
       from pt_emp_history
      where empid = :old.empid) 
  loop
     l_sdate := c1.prev_start_date;
  end loop;
  add_role_history(:old.empid, 
                  nvl(l_sdate,:old.hire_date), 
                  sysdate, 
                  :old.roleid, 
                  :old.salary
                  );
end if;

END;
/
ALTER TRIGGER "UPDATE_EMP_HISTORY" ENABLE;
